import createMuiTheme from '@material-ui/core/styles/createMuiTheme';


export const styles = theme => ({
    layout: {
      width: 'auto',
      display: 'auto',
      marginLeft: theme.spacing.unit * 3,
      marginRight: theme.spacing.unit * 3,
      [theme.breakpoints.up(420 + theme.spacing.unit * 3 * 2)]: {
        width: 500,
        marginLeft: 'auto',
        marginRight: 'auto',
      },
    },
    paper: {
      marginTop: theme.spacing.unit * 3,
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      padding: `${theme.spacing.unit * 3}px ${theme.spacing.unit * 3}px ${theme.spacing.unit * 3}px`
    },
    avatar: {
      margin: theme.spacing.unit,
      backgroundColor: theme.palette.primary.main,
    },
    form: {
      width: '100%',
      marginTop: theme.spacing.unit * 10,
    },
    submit: {
      marginTop: theme.spacing.unit*1,
      marginLeft:'auto',
      marginRight: 'auto',
    },
    root: {
      width: '100%',
      maxWidth: '360px',
      backgroundColor: theme.palette.background.paper,
    },
  });

  export const button1 = createMuiTheme({
    typography: {
      useNextVariants: true,
    },
    palette:
    {primary:{
      main: '#2196f3',
    }}
  });
  export const button2 = createMuiTheme({
    typography: {
      useNextVariants: true,
    },
    palette:
    {primary:{
      main: '#283593',
    }}
  });

  export const button3 = createMuiTheme({
    typography: {
      useNextVariants: true,
    },
    palette:
    {primary:{
      main: '#C62828',
    }}
  });
